import logo from './logo.svg';
import './App.css';
import Header from './Header';
import HeaderMarquee from './HeaderMarquee';
import Footer from './Footer';
import Caraousel from './Caraousel';
import { Carousel } from 'bootstrap';

function App() {
  return (
    <div className="App">
    <HeaderMarquee />
    <Header />
    <Carousel />

    <Footer />
    </div>
  );
}

export default App;
